import React from "react";

export default function SelectField({ label,value, options, onChange, type, name }) {
  const handleChange = (e) => {
    onChange(e, name);
  };

  return (
    <div>
      <label>{label}</label>
      <select value={value} type={type} onChange={handleChange} >
        <options></options>
      </select>
    </div>
  );
}
